import React from 'react';
import Navbar,{ CustomFooter } from './components/Navbar' ;


function App() {
  return (
    <div className="App">
      <Navbar brandname='ReactRouter'/>
      <div className="row">
        <div className="col s12 main-column"> 
          <h3 className="center-align">Hello World </h3>
        </div>

        <div className="col s6 left-column"> 
          <h3>left World </h3>
        </div>

        <div className="col s6 right-column"> 
          <h3>Right World </h3>
        </div>
       </div>
    </div>
  );
}

export default App;
